import React from 'react'
import '../styles/sections/Dashboardplansettings.css'
import { useState, useEffect } from 'react'
import axios from 'axios'

function Dashboardplansettings(props) {

    const[plans] = useState({
        influencer: ['free', 'starter', 'growth'],
        influencer_price: [0, 4.99, 9.99],
        influencer_number_campaigns: [3, 7, 15],
        brand: ['free', 'basic', 'advanced', 'beyond']
    })

    useEffect(() => {
        axios.get(`${process.env.REACT_APP_ROUTE}/api/global/getprofile`, {
            params: {
                id: props.id
            }
        }).then((res) => {
            setOldprofile(res.data.user_profile.profile_picture)
            setProfile(res.data.user_profile.profile_picture)
            setFirstname(res.data.user_profile.firstname)
            setLastname(res.data.user_profile.lastname)
            setEmail(res.data.user_profile.email)
            setBirthdate(res.data.user_profile.birthdate)
            setProvince(res.data.user_profile.province)
            setCountry(res.data.user_profile.country)
        }).catch(err => alert(err))

    }, [])

    return (
        <div className='plansettings-container'>
            <div className='plansettings-container-title'>Subscription</div>
            <div className='plansettings-container-subscription'>
                <table>
                    <tbody>
                        <tr>
                            <th>
                            </th>
                            {plans.influencer.map((plan, index) => (
                                <th>
                                    <div>{plan}</div>
                                    <div className='plansettings-plan-price'>${plans.influencer_price[index]}</div>
                                    <button>Change plan</button>
                                </th>
                            ))}
                        </tr>
                        <tr>
                            <td>
                                <span>Active campaigns</span>
                            </td>
                            {plans.influencer_number_campaigns.map((campaign, index) => (
                                <td>{campaign}</td>
                            ))}
                        </tr>
                    </tbody>
                </table>

            </div>
        </div>
    )
}

export default Dashboardplansettings
